import React from 'react';

export default function Portfolio() {
    return (
        <div id='portfolio'>
            <h1>Portfolio</h1>
            <div class="card">
                <div class="card-image"></div>
                <div class="category"> Local Finds </div>
                <div class="heading"> A heading that must span over two lines</div>
            </div>
        </div>
    )
}
